import React, { Component } from "react";
import "./App.css";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import green from "@material-ui/core/colors/green";

const styles = theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap"
  },
  margin: {
    margin: theme.spacing.unit
  },
  cssLabel: {
    "&$cssFocused": {
      color: green[500]
    }
  },
  cssFocused: {},
  cssUnderline: {
    "&:after": {
      borderBottomColor: green[500]
    }
  },
  cssOutlinedInput: {
    "&$cssFocused $notchedOutline": {
      borderColor: green[500]
    }
  },
  notchedOutline: {},
  bootstrapRoot: {
    "label + &": {
      marginTop: theme.spacing.unit * 3
    }
  },
  bootstrapInput: {
    borderRadius: 4,
    backgroundColor: theme.palette.common.white,
    border: "1px solid #ced4da",
    fontSize: 16,
    padding: "10px 12px",
    transition: theme.transitions.create(["border-color", "box-shadow"]),
    // Use the system font instead of the default Roboto font.
    fontFamily: [
      "-apple-system",
      "BlinkMacSystemFont",
      '"Segoe UI"',
      "Roboto",
      '"Helvetica Neue"',
      "Arial",
      "sans-serif",
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"'
    ].join(","),
    "&:focus": {
      borderColor: "#80bdff",
      boxShadow: "0 0 0 0.2rem rgba(0,123,255,.25)"
    }
  },
  bootstrapFormLabel: {
    fontSize: 18
  }
});

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="Header">
          <div className="ShowCase">
            <h1>Museum Locale</h1>
            <p>Get the artworks based on your criteria</p>
          </div>
          <div className="Text">
            <TextField
              className={classes.margin}
              InputLabelProps={{
                classes: {
                  root: classes.cssLabel,
                  focused: classes.cssFocused
                }
              }}
              InputProps={{
                classes: {
                  root: classes.cssOutlinedInput,
                  focused: classes.cssFocused,
                  notchedOutline: classes.notchedOutline
                }
              }}
              label="Custom CSS"
              variant="outlined"
              id="custom-css-outlined-input"
            />
            <TextField
              className="TextField"
              label="Enter Branch"
              variant="outlined"
            />
            <TextField
              className="TextField"
              label="Enter Artist"
              variant="outlined"
            />
            <TextField
              className="TextField"
              label="Enter Decade"
              variant="outlined"
            />
          </div>
          <div className="Button">
            <Button variant="contained" color="secondary">
              Submit
            </Button>
          </div>
          <div className="Arrow">
            <i class="far fa-arrow-alt-circle-down" />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default App;
